<span class="p9 ft2">DICHIARA E SI IMPEGNA</span><br><br>  
<span class="ft9"><SPAN class="ft7">∙</SPAN><SPAN class="ft8" style="font-size:11px">- A comunicare tempestivamente alla Società, rimanendo al proprio domicilio, la variazione di una delle condizioni riportate, con idonee modalità, e prende atto che, fintantochè non comunicherà eventuali variazioni, l’autocertificazione conserverà la sua validità per un periodo di 30 giorni, scaduti i quali la stessa dovrà essere rinnovata;</SPAN></span>
<br><span class="ft9" style="font-size:11px"><SPAN class="ft7">∙</SPAN> - A  farsi rilevare, ove necessario, la temperatura corporea all'accesso alle strutture sportive (in caso di temperatura &gt; 37.5 °C non gli sarà consentito l’accesso). </span>
<br><span class="ft0" style="font-size:11px"><SPAN class="ft5">∙</SPAN> - A mantenere la distanza di almeno 1 metro in caso di assenza di attività fisica e, per tutti i momenti in cui la disciplina sportiva lo consente, di almeno 2 metri durante l’attività fisica, fatta eccezione per le attività di contatto </span>
<br><span class="ft0" style="font-size:11px"><SPAN class="ft5">∙</SPAN> - Ad evitare di lasciare in luoghi condivisi con altri gli indumenti indossati, ma riporli in zaini o borse personali chiuse;</span>
<br><span class="ft3" style="font-size:11px"><SPAN class="ft5">∙</SPAN> - A lavarsi frequentemente le mani con prodotti igienizzanti, a starnutire o tossire in un fazzoletto o sull'incavo del gomito, evitando il contatto delle mani con le secrezioni respiratorie, a non toccarsi occhi naso e bocca con le mani e a non condividere borracce, bicchieri o bottiglie;</span>
<br><span class="ft0" style="font-size:11px"><SPAN class="ft5">∙</SPAN> - Ad utilizzare la mascherina quando previsto dai protocolli vigenti;</span>
<br><span class="ft0" style="font-size:11px"><SPAN class="ft5">∙</SPAN> - Di essere a conoscenza delle misure di contenimento del contagio da COVID 19 e della corretta prassi igienica individuale;</span>
<br><span class="ft9"><SPAN class="ft7">∙</SPAN> - Di essere a conoscenza delle sanzioni previste per le dichiarazioni mendaci e per il mancato rispetto delle misure comportamentali ed igienico‐ sanitarie;</span>
<br><span class="ft17"><SPAN class="ft15">∙</SPAN> - Che da almeno 14 giorni risulta in buona salute e senza sintomi o patologie suggestive di COVID‐19 quali febbre, tosse, difficoltà respiratoria, alterazione di gusto e olfatto, raffreddore, mal di gola, diarrea o, in alternativa, di essere esser stato visitato/aver fatto visitare il minore dal medico di base e che il medesimo non ha riscontrato alcuna patologia riconducibile al COVID‐19;</span>
<br><span class="ft9"><SPAN class="ft7">∙</SPAN> - Di non essere sottoposto alla misura della quarantena domiciliare obbligatoria o precauzionale;</span>
<br><span class="ft3"><SPAN class="ft15">∙</SPAN> - Che negli ultimi 14 giorni non ha avuto contatti con soggetti risultati positivi al COVID‐19 o sottoposti a quarantena obbligatoria o precauzionale e di non aver frequentato zone a rischio epidemiologico secondo le indicazioni dell’OMS e/o della Autorità nazionali e regionali;</span>
<p class="ft17">Io sottoscritto/a attesto sotto mia responsabilità che quanto sopra dichiarato corrisponde al vero consapevole delle conseguenze civili e penali di una falsa dichiarazione (art. 46 D.P.R. n. 445/2000), anche in relazione al rischio di contagio all’interno della struttura sportiva ed alla pratica di attività sportive autorizzo la Società sportiva al trattamento dei miei dati particolari relativi allo stato di salute contenuti in questo modulo ed alla sua conservazione ai sensi del Reg. Eu 2016/679/UE e della normativa nazionale vigente. Più in particolare, ai sensi del D. Lgs. 196/03 (Codice in materia di trattamento dei dati), come modificato e integrato dal D. Lgs. 110/2008 e dal Regolamento Europeo 2016/679/UE (General Data Protection Regulation) la Società sportiva si impegna a rispettare il carattere riservato delle informazioni ricevuto dall’interessato e il trattamento dei dati sarà improntato ai principi di correttezza, liceità e proporzionalità.</p>
<span class="ft20">Il trattamento dei dati forniti dagli interessati è strettamente funzionale agli adempimenti connessi <SPAN class="ft19">unicamente con le misure precauzionali e di sicurezza e contenimento del contagio.</SPAN></span>
<P class="ft17">Il trattamento dei dati è effettuato avvalendosi sia di mezzi informatici che cartacei protetti e non accessibili al pubblico. I dati forniti possono essere comunicati ad altre Amministrazioni Pubbliche per finalità connesse all’espletamento delle misure di prevenzione al contagio.</P>
<span class="ft9" style="font-size:11px">Gli interessati hanno diritto di accedere ai propri dati personali, di chiederne la rettifica, l’aggiornamento e la cancellazione, se incompleti, erronei o raccolti in violazione della legge, nonché di opporsi la loro trattamento per motivi legittimi, presentare reclamo al Garante dei dati personali, rivolgendo le richieste al soggetto sopra indicato.</span>

